/**
 * 作者：Mr.wang
 * 时间：2022/4/11
 * 文件名：index
 * 项目名称：脚手架
 * WebStorm
 */
import React, {Component} from "react";

export default class ListArea extends Component {
    state = {
        showData:[]
    }
    componentDidMount() {
        this.state.showData = this.props.showData;
    }

    render() {
        const  {showData} = this.state
        return (
            <div>
                <ul>
                    {showData.map(item => {
                        return <li>{item}</li>
                    })}
                </ul>
            </div>
        );
    }
}
